import React, { Component } from 'react'

export default class App extends Component {

  constructor(props){
    super(props)
    this.url="https://test-es.edamam.com/search?q="
    this.state={
      data:[],
      searchValue:""
    }
    console.log("constructor");
  }

  // react will execute this code just before teh render method
  static getDerivedStateFromProps(){
    console.log("getDerivedStateFromProps");
    return null

  }

  componentDidMount(){
    console.log("componentDidMount")
  }

  searchData=(e)=>{
    e.preventDefault()
    fetch(this.url + this.state.searchV)
  }

  render() {
    console.log("render");
    return (
      <div>
        <h1>Recipe App</h1>
         <form onSubmit={this.searchData} >
           <label>Search Recipe: <input type="text" onChange={(e)=>this.setState({searchValue:e.target.value})} /> </label>
           <input type="submit" value="search"/>
         </form>
      </div>
    )
  }
}
